mapper.select:

    select

      distinct


    from (
    	SELECT css_id, css_access, css_host, css_number, css_car, css_add_time, css_current_time, css_rented, css_warn, css_rfid, css_rfid_dte, css_obd_mile, css_engine_t, css_mileage, css_speed, css_motor, css_oil, css_power, css_ev_battery, css_charging, css_fuel_mileage, css_electric_mileage, css_endurance, css_temperature, css_csq, css_power_consumption, css_longitude, css_latitude, css_gps_valid, css_gps_cn, css_gps_count, css_dir, css_circular, css_ptc, css_compres, css_fan, css_saving, css_door, css_engine, css_key, css_gear, css_light, css_lock, css_net_type, css_base_lac, css_base_ci, css_order, css_mo_data,b.sh_name,c.cs_vin
		FROM cs_state a
		LEFT JOIN srv_host b ON a.css_access=b.sh_id
		LEFT JOIN cs_vehicle_machine_rel c ON a.css_number=c.cs_number
    ) a




      order by ${orderByClause}


    select 

    from (
    	SELECT css_id, css_access, css_host, css_number, css_car, css_add_time, css_current_time, css_rented, css_warn, css_rfid, css_rfid_dte, css_obd_mile, css_engine_t, css_mileage, css_speed, css_motor, css_oil, css_power, css_ev_battery, css_charging, css_fuel_mileage, css_electric_mileage, css_endurance, css_temperature, css_csq, css_power_consumption, css_longitude, css_latitude, css_gps_valid, css_gps_cn, css_gps_count, css_dir, css_circular, css_ptc, css_compres, css_fan, css_saving, css_door, css_engine, css_key, css_gear, css_light, css_lock, css_net_type, css_base_lac, css_base_ci, css_order, css_mo_data,b.sh_name,c.cs_vin
		FROM cs_state a
		LEFT JOIN srv_host b ON a.css_access=b.sh_id
		LEFT JOIN cs_vehicle_machine_rel c ON a.css_number=c.cs_number
    ) a
    where css_id = #{cssId,jdbcType=INTEGER}
